import React from "react";

function Footer(props){
    return(
     <section id="footer">
        <div className="container">
            <div className="row">
                <div className="col-md-6">
                    <h2>CONTACT US</h2>
                </div>
            </div>
        </div>
     </section>
    );
}

export default Footer;
